import { makeStyles } from '@material-ui/core/styles';
import React from 'react';
import annotationlist from '../../static/annotationlist.json';
import TextField from '@material-ui/core/TextField';
import FormControl from '@material-ui/core/FormControl';
import Button from '@material-ui/core/Button';
import Checkbox from '@material-ui/core/Checkbox';
import clsx from 'clsx';

const qalist = annotationlist.annotatonlist;


function qaform(resultKey, resultValue) {
    return (
        <FormControl>
            <div style={{ marginBottom: '5%', display:'flex', flexDirection:"row" }}>
                <Checkbox />
                <TextField
                    label={resultKey}
                    defaultValue={resultValue}
                    variant="outlined"
                    fullWidth
                    InputProps={{
                        readOnly: true,
                    }}
                />
            </div>
        </FormControl>
    );
}


